            result.Write(Member_Old.UID);
            return result.GetBytes();
        }

        public byte[] GetEquipments()
        {
            var result = new PangyaBinaryWriter();
            result.Write(UserEquip.CADDIE);
            result.Write(UserEquip.CHARACTER_ID);
            result.Write(0); //ClubIndex
            result.Write(0); //BallTypeID
            result.Write(UserEquip.GetItemSlotData());

            //DECORATION  --> player.Inventory.GetDecoration()
            result.Write(0); //BackGroundIndex
            result.Write(0); //FrameIndex
            result.Write(0); //StickerIndex
            result.Write(0); //SlotIndex
            result.Write(0); //Unknown
            result.Write(0); //TitleIndex
            //-----

            //DECORATION  --> player.Inventory.GetDecorationTypeData()
            result.Write(0); //BackGroundTypeID
            result.Write(0); //FrameTypeID
            result.Write(0); //StickerTypeID
            result.Write(0); //SlotTypeID
            result.Write(0); //UnknownTypeID
            result.Write(0); //TitleTypeID
                                      //-----

            result.Write(UserEquip.MASCOT_ID);


            result.WriteEmptyBytes(8);
            var GetBytes = result.GetBytes();
            return GetBytes;
        }

